import { Container, Row, Col, Navbar, Nav } from 'react-bootstrap';

function HeroSection() {
  return (
    <div className="d-flex flex-column  heroSection">
      <Row className="d-inline">
        <Col className=" text-left">
          <p className="text-white bold h4">Hallo,mein Name ist</p>
          <p className="primaryColor display-3 bold">Eremiya Rifat</p>
          <p className="text-white bold biggerNormalText h2">Ich bin</p>
          <p className="primaryColor display-1 bold ">Webdesigner</p>
        </Col>
      </Row>
    </div>
  );
}

export default HeroSection;
